import { BrowserRouter as Router, Routes, Route } from 'react-router-dom'; 
import Home from './Home'; // Correct if the file is named Home.js (capital H)


function App() {
  return (
    <Router>
      <Switch>
        <Route path="/" exact component={Home} />  {/* This shows the Home component at the root route */}
        {/* Add more routes here for other pages */}
      </Switch>
    </Router>
  );
}

export default App;
